  return (
    <div className="row">
      <div className="col-6">
        <div className="text-primary">
          {quoteSummary &&
            quoteSummary?.quoteSummary?.result[0].quoteType.symbol.replace(
              ".BK",
              ""
            )}
        </div>
        <div>
          {quoteSummary &&
            quoteSummary?.quoteSummary?.result[0].quoteType.longName}
        </div>
      </div>
      <div className="col-2">
        <div>
          {quoteSummary?.quoteSummary?.result[0].financialData.currentPrice.fmt}{" "}
          บาท
        </div>
        <div>ราคาตลาด</div>
      </div>
      <div className="col-2">
        <div>{marketCap}</div>
        <div>มูลค่าตลาด</div>
      </div>
      <div className="col-2"></div>
    </div>
  );
};

export default Overview;
